function get_article_tokens() {
  let text = document.getElementsByClassName("park-article__body")[0].innerText;
  let tokens = text.split(/\s/);
  let tokens_set = new Set();
  for (let x in tokens) {
    tokens_set.add(strip(tokens[x]));
  }
  return tokens_set;
}

function strip(token) {
	return token.replace(/^["«", "»", "■", "„", "(", " "]|["“", ".", ",", "?", "!", ":", ")", " "]+$/g, '');
}

function norm(token) {
  token = token.trim();
  return token.split("").sort().join("");
}

function unscramble_token(scrambled_token, dictionary) {

  let sorted_token = scrambled_token.split("").sort().join("");
  if (sorted_token in dictionary) {
    //alert(dictionary[sorted_token]);
    console.log(Object.keys(dictionary[sorted_token]).length);
    if (Object.keys(dictionary[sorted_token]).length > 0) {
      let token_count = dictionary[sorted_token];
      let sorted_tokens = sorted_keys_by_value(token_count);
      return sorted_tokens[0]; // TODO: Make dropdown field
    }
  }
  
  let norm_token = norm(scrambled_token);
  let [pre, norm_token_stripped, post] = split_pre_post(norm_token);
  
  if (norm_token_stripped in dictionary) {
    if (Object.keys(dictionary[norm_token_stripped]).length > 0) {
      let token_count = dictionary[norm_token_stripped];
      let sorted_tokens = sorted_keys_by_value(token_count);
  	  return pre + sorted_tokens[0] + post; // TODO: Make dropdown field?
    }
  }
  // No translation found
  return "<span style=\"color: red\">" + pre + norm_token_stripped + post + "</span>";
}

function split_pre_post(token) {
  let sorted = token.split("").sort().join("");
  const pre_chars = ["«", "■", "‚", "„", "("];
  const post_chars = ["»", "’", "“", ".", ",", "?", "!", ":", ")"];
  let pre = "";
  let non_special = "";
  let post = "";
	for (let c of sorted) {
  	if (pre_chars.includes(c)) {
      pre += c;
    } else if (post_chars.includes(c)) {
      post += c;
    } else {
      non_special += c;
    }
  }
  return [pre, non_special, post];
}

function unscramble_article(dictionary) {
  var blurred_ps = document.getElementsByClassName("text-blurred");
  while (blurred_ps.length) {
    // Translate
    let recovered_text_tokens = [];
    let scrambled_tokens = blurred_ps[0].innerText.split(/\s/);
    scrambled_tokens.forEach(key => recovered_text_tokens.push(unscramble_token(key, dictionary)));
    blurred_ps[0].innerHTML = recovered_text_tokens.join(" ");
    // Remove blur
    blurred_ps[0].classList.remove("text-blurred");
  }
  var reduced = document.getElementsByClassName("park-article--reduced");
  while (reduced.length) {
    reduced[0].classList.remove("park-article--reduced");
  }
}

function sorted_keys_by_value(dict) {
  // https://www.educative.io/answers/how-can-we-sort-a-dictionary-by-value-in-javascript
  // Step - 1
  // Create the array of key-value pairs
  var items = Object.keys(dict).map(
    (key) => { return [key, dict[key]] });

  // Step - 2
  // Sort the array based on the second element (i.e. the value)
  items.sort(
    (first, second) => { return second[1] - first[1] } // reverse Order
  );

  // Step - 3
  // Obtain the list of keys in sorted order of the values.
  var keys = items.map(
    (e) => { return e[0] });
  
  return keys
}


